Verenigde Staten
Komedie / Drama
110 minuten

geregisseerd door Kirk Jones
met Anna Kendrick, Elizabeth Banks en Cameron Diaz

De film is een moderne kijk op de liefde door de ogen van vijf koppels die met elkaar verbonden zijn door het wel en wee dat ze ervaren wanneer ze een kind verwachten. Uiteindelijk zullen ze geconfronteerd worden met de universele waarheid: wat men ook plant, het leven brengt niet altijd wat men verwacht.



Quality over Quantity (QoQ) Releases
Vertaling: Nightfalls, SK, Esthor en Desiree



